import React from "react";
import logoImage from './logo.png';

const customStyle = {
  background: "yellow",
  margin: "auto -16px",
  padding: "16px 32px",
  fontFamily: "Times New Roman",
  fontWeight: "bold",
  boxShadow: "0 0 10px rgba(0, 0, 0, 0.3)",
  display: "flex",
  alignItems: "center",
  justifyContent: "space-between",
  direction: "row-reverse"
};

const logoStyle = {
  height: "50px",
  width: "50px"
};

const titleStyle = {
  margin: "0 0 0 16px" // To add some space between the text and the edge
};

function Header() {
  return (
    <header style={customStyle}>
      <h1 style={titleStyle}>Aptitude Test</h1>
      <img src={logoImage} alt="Company Logo" style={logoStyle} />
    </header>
  );
}

export default Header;
